insert  into `product`(`id`,`name`,`category_id`,`description`,`address`,`image_id`,`price`,`is_promo`,`created_at`,`updated_at`,`deleted_at`,`meta_title`,`meta_description`,`meta_keyword`,`slug`,`company_id`,`created_by`,`updated_by`,`deleted_by`) values ('2da6da90-abae-11e6-9faa-4f36e6258113','Kintamani','39cdbcc0-aafb-11e6-94e3-39a82987b32d','<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod<i> tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation <br/></i></p><img src=\"http://il2.picdn.net/shutterstock/videos/2835478/thumb/8.jpg?i10c=img.resize(height:160)\" width=\"137\" height=\"77\"/>&#10; &#10;  &#10;Your browser does not support the video tag.<br/><br/><br/><br/>&#24456;&#22909;<br/>','dsd','c86678c0-b150-11e6-9c26-1534b52bea2b',NULL,NULL,'2016-11-16 11:38:46','2016-12-14 16:18:54',NULL,NULL,NULL,NULL,'kintamani','edcb5600-18aa-11e6-90f8-dff29156d8f1','admin','admin',NULL),('397dc2c0-b2b7-11e6-80cd-c5d4781aa5b3','Kura Kura Bus','369f2d20-aafb-11e6-a879-654bc8b615bb','<p>Sangeh is a small fertile monkey forest dwelling by the group of monkeys. It is located in Sangeh countryside, Badung Regency, north part of Denpasar town. It is one of tourist destinations in Bali which is strategically located beside of the road. The good road has been provided to reach this place and many tourists has come to this place to see the cute of monkeys.<br/><br/>Sangeh Monkey Forest History In the century 17 at Monarchic golden era of Mengwi, I Gusti Agung Ketut Karangasem, the son of I Gusti Agung Made Agung, had built the temple in the middle of nutmeg forest and hereinafter it is called as Bukit Sari Temple (like small forest with mixture vegetation and broadness about 10,8 ha). The mythos of this Sangeh Forest is relevant to the happening of forest wood evacuation from Agung Mount in Karangasem to Mengwi in regency of Badung. But on the way of the evacuation, it seen or known by somebody so that it finally becomes the forest which is named with Sangeh. This Nutmeg Forest is formally as a Tourism Garden Nature, which is also as a holy area of temple for worshiping to the god. It is executed from local people from Sangeh Countryside and its surrounding area. It is also become a secret function beside of tourist object as a commercial tourism business.<br/><br/>retrieved from:&#160; http://apm-bayukeybotz.blogspot.co.id/2012/01/sangeh-monkey-forest-bali.html<br/></p>',NULL,'6f636500-b2b7-11e6-b6dd-85e31e722cce',NULL,NULL,'2016-11-25 10:31:09','2016-11-28 15:24:12',NULL,NULL,NULL,NULL,'kura-kura-bus','edcb5600-18aa-11e6-90f8-dff29156d8f1','admin','admin',NULL),('46b2f8b0-b2b8-11e6-a5a5-bd39710a2b8d','Batur Mt','369f2d20-aafb-11e6-a879-654bc8b615bb',NULL,NULL,'4904e0b0-b2b8-11e6-9a0b-d7a25ab58634',NULL,NULL,'2016-11-25 10:38:41','2016-11-30 14:02:45',NULL,NULL,NULL,NULL,'batur-mt','edcb5600-18aa-11e6-90f8-dff29156d8f1','admin','admin',NULL),('554eb960-abab-11e6-9180-2b15bd348c85','Test','109c4ba0-aaff-11e6-b724-95c89052ee0c','<p>ds<br/></p>','ds','fa0b8570-abac-11e6-b8dd-c1993509a324',NULL,NULL,'2016-11-16 11:18:24','2016-11-16 11:36:08','2016-11-16 11:36:08','ds','<p>dseweww<br/></p>','sds','test','edcb5600-18aa-11e6-90f8-dff29156d8f1','admin','admin','admin'),('9105a690-abad-11e6-8b29-9934b2e895fb','Ubud Tour','369f2d20-aafb-11e6-a879-654bc8b615bb','<p><i>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod<br/>tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam,<br/>quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo<br/>consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse<br/>cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non<br/>proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</i></p><p><i><br/></i></p><p><i>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod<br/>tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam,<br/>quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo<br/>consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse<br/>cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non<br/>proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</i><br/></p>','Jl. Andong','943f0bc0-abad-11e6-b71b-455c0c966a0e',NULL,NULL,'2016-11-16 11:34:23','2016-11-16 11:35:15',NULL,'aaa','<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod<br/>tempor incididunt ut','bbb','ubud-tour','edcb5600-18aa-11e6-90f8-dff29156d8f1','admin','admin',NULL),('b3f181a0-b2b8-11e6-899c-7bdfaf0ca1a8','Ayung River Rafting','369f2d20-aafb-11e6-a879-654bc8b615bb','<p>Ayung River rafting in Bali offers an exciting day out at the location where the island&#8217;s white water rafting adventure scene was first introduced. As Bali&#8217;s longest and largest river, Ayung River and its rafting offer a thrilling pastime that also offers sightseeing opportunities of Central Bali&#8217;s upland, where you get to cool off under a waterfall, wade through or jump into crystal-clear freshwater pools, and catch the occasional sight of exotic birds and wildlife. The Ayung River rafting valley location lies northwest of the Ubud main hub, and the river runs down an approximate 75km, where different white water rafting operators take their various starting and finish points. Some take off at the Petang village, roughly an hour&#8217;s drive from Denpasar and others further up north in Campuhan, passing by unique bat caves in the valley. Overall, the white water rafting adventure lets you enjoy Bali&#8217;s real natural beauty while sharing the fun and thrills with friends.<br/><br/>Read more at: http://www.bali-indonesia.com/magazine/ayung-river-rafting.htm?cid=ch:OTH:001</p><p><br/></p>',NULL,'b79988c0-b2b8-11e6-84ac-27a53ecd49af',NULL,NULL,'2016-11-25 10:41:44','2016-11-30 14:02:58',NULL,NULL,NULL,NULL,'ayung-river-rafting','edcb5600-18aa-11e6-90f8-dff29156d8f1','admin','admin',NULL),('b7fcb180-b145-11e6-a084-a9a44b31c89e','Sangeh Tour','369f2d20-aafb-11e6-a879-654bc8b615bb','<p>Sangeh is a small fertile monkey forest dwelling by the group of monkeys. It is located in Sangeh countryside, Badung Regency, north part of Denpasar town. It is one of tourist destinations in Bali which is strategically located beside of the road. The good road has been provided to reach this place and many tourists has come to this place to see the cute of monkeys.<br/><br/>Sangeh Monkey Forest History In the century 17 at Monarchic golden era of Mengwi, I Gusti Agung Ketut Karangasem, the son of I Gusti Agung Made Agung, had built the temple in the middle of nutmeg forest and hereinafter it is called as Bukit Sari Temple (like small forest with mixture vegetation and broadness about 10,8 ha). The mythos of this Sangeh Forest is relevant to the happening of forest wood evacuation from Agung Mount in Karangasem to Mengwi in regency of Badung. But on the way of the evacuation, it seen or known by somebody so that it finally becomes the forest which is named with Sangeh. This Nutmeg Forest is formally as a Tourism Garden Nature, which is also as a holy area of temple for worshiping to the god. It is executed from local people from Sangeh Countryside and its surrounding area. It is also become a secret function beside of tourist object as a commercial tourism business.<br/></p><p>retrieved from:&#160; http://apm-bayukeybotz.blogspot.co.id/2012/01/sangeh-monkey-forest-bali.html<br/></p>',NULL,'ba4ff920-b145-11e6-9ee8-3370670013a9',NULL,NULL,'2016-11-23 14:26:07','2016-11-23 14:26:14',NULL,NULL,NULL,NULL,'sangeh-tour','edcb5600-18aa-11e6-90f8-dff29156d8f1','admin','admin',NULL),('c0bf9cc0-b2b7-11e6-96a5-3d069f644f26','Elephant Ridding','369f2d20-aafb-11e6-a879-654bc8b615bb','<p>Sangeh is a small fertile monkey forest dwelling by the group of monkeys. It is located in Sangeh countryside, Badung Regency, north part of Denpasar town. It is one of tourist destinations in Bali which is strategically located beside of the road. The good road has been provided to reach this place and many tourists has come to this place to see the cute of monkeys.<br/><br/>Sangeh Monkey Forest History In the century 17 at Monarchic golden era of Mengwi, I Gusti Agung Ketut Karangasem, the son of I Gusti Agung Made Agung, had built the temple in the middle of nutmeg forest and hereinafter it is called as Bukit Sari Temple (like small forest with mixture vegetation and broadness about 10,8 ha). The mythos of this Sangeh Forest is relevant to the happening of forest wood evacuation from Agung Mount in Karangasem to Mengwi in regency of Badung. But on the way of the evacuation, it seen or known by somebody so that it finally becomes the forest which is named with Sangeh. This Nutmeg Forest is formally as a Tourism Garden Nature, which is also as a holy area of temple for worshiping to the god. It is executed from local people from Sangeh Countryside and its surrounding area. It is also become a secret function beside of tourist object as a commercial tourism business.<br/><br/>retrieved from:&#160; http://apm-bayukeybotz.blogspot.co.id/2012/01/sangeh-monkey-forest-bali.html<br/></p>',NULL,'c200d400-b2b7-11e6-82f8-0f854dfeca37',NULL,NULL,'2016-11-25 10:34:56','2016-11-28 15:24:21',NULL,NULL,NULL,NULL,'elephant-ridding','edcb5600-18aa-11e6-90f8-dff29156d8f1','admin','admin',NULL);

